    const [summary, setSummary] = useState('');

    return(
        <form>
            <input type="title" placeholder={'Title'}/>
            <input type="summary" placeholder={'Summary'}/>
            <input type="file"/>
            <ReactQuill />
            <button>Create post</button>
        </form>
    )
}
